// 组件
import D2Crud from './components/D2Crud/index'
import MyTime from '../../components/my-time'
import util from '@/libs/util'
import axios from 'axios'
import Qs from 'qs'

// 请删除下面代码中你不需要的部分
export default {
  name: 'Student-management',
  components: {
    D2Crud,
    MyTime
  },
  // 数据
  data () {
    return {
        flag : util.cookies.get('user-flag'),
        roommate:{},
    }
  },
  // 计算属性
  computed: {},
  // 侦听器
  watch: {},
  // 生命周期钩子
  beforeCreate () {},
  created () {},
  beforeMount () {},
  mounted () {
    this.getMyRoommate()
  },
  beforeUpdate () {},
  updated () {},
  activated () {},
  deactivated () {},
  beforeDestroy () {},
  destroyed () {},
  // 事件处理方法
  methods: {
    getMyRoommate(){
      var _this = this
       axios.post('http://localhost:8080/GetRoommate',Qs.stringify({dormid:util.cookies.get("user-dorm-id")}))
        .then(function (response) {
          console.log(response)
          _this.roommate = response.data
        })
        .catch(function (error) {
          console.log(error);
        });
    }
  }
}
